import React from 'react';
import logoImg from '../../assets/images/logo.svg';

function Landing() {
    return (
        <div id="page-landing">
            <div id="page-lading-content" className="container">
                <div className="logo-container">
                    <img src={logoImg} alt="porffy"/>
                </div>
            </div>
        </div>
    )
}

export default Landing;
